import React, { Component } from "react";
// import $ from "jquery";
// import { Navbar, Nav, NavItem } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Profile from "../Profile/Profile";
import Skills from "../Profile/Skills";
import StackProgress from "../Profile/StackProgress";
import Education from "../Profile/Education";
import Achievements from "../Profile/Achievements";
import MyStuff from "../MyStuff/MyStuff";
import Experience from "../Profile/Experience";
import Projects2 from "../Projects/Projects2";
import { Nav, Navbar } from "react-bootstrap";

class Header extends Component {
  titles = [];
  constructor(props) {
    super(props);
    this.state = {
      profileData: this.props.profileData.basic_info,
      projectData: this.props.projectData.basic_info,
    };
  }
  render() {
if (this.props.profileData) {
  var name = this.props.profileData.name;
  this.titles = this.props.profileData.titles
    .map((x) => [x.toUpperCase(), 1500])
    .flat();
}

    const HeaderTitleTypeAnimation = React.memo(
      () => {
        return this.titles;
      },
      (props, prevProp) => true
    );

    return (
      <header
        id="home"
        style={{ height: window.innerHeight - 100, display: "block" }}
      >
        <a
          href="https://github.com/reedoooo/portfolio-prep"
          target="_blank"
          rel="noreferrer"
          className="github-corner"
          aria-label="View source on GitHub"
        >
          <svg
            width="90"
            height="90"
            viewBox="0 0 250 250"
            style={{
              fill: "#151513",
              color: "#fff",
              position: "absolute",
              top: 0,
              border: 0,
              left: 0,
              transform: "scale(-1, 1)",
              zIndex: 9999,
            }}
            aria-hidden="true"
          >
            <path d="M0,0 L115,115 L130,115 L142,142 L250,250 L250,0 Z"></path>
            <path
              d="M128.3,109.0 C113.8,99.7 119.0,89.6 119.0,89.6 C122.0,82.7 120.5,78.6 120.5,78.6 C119.2,72.0 123.4,76.3 123.4,76.3 C127.3,80.9 125.5,87.3 125.5,87.3 C122.9,97.6 130.6,101.9 134.4,103.2"
              fill="currentColor"
              style={{ transformOrigin: "130px 106px" }}
              className="octo-arm"
            ></path>
            <path
              d="M115.0,115.0 C114.9,115.1 118.7,116.5 119.8,115.4 L133.7,101.6 C136.9,99.2 139.9,98.4 142.2,98.6 C133.8,88.0 127.5,74.4 143.8,58.0 C148.5,53.4 154.0,51.2 159.7,51.0 C160.3,49.4 163.2,43.6 171.4,40.1 C171.4,40.1 176.1,42.5 178.8,56.2 C183.1,58.6 187.2,61.8 190.9,65.4 C194.5,69.0 197.7,73.2 200.1,77.6 C213.8,80.2 216.3,84.9 216.3,84.9 C212.7,93.1 206.9,96.0 205.4,96.6 C205.1,102.4 203.0,107.8 198.3,112.5 C181.9,128.9 168.3,122.5 157.7,114.1 C157.9,116.9 156.7,120.9 152.7,124.9 L141.0,136.5 C139.8,137.7 141.6,141.9 141.8,141.8 Z"
              fill="currentColor"
              className="octo-body"
            ></path>
          </svg>
        </a>
        <Router>
          {/* <Navigation profileData={this.props.profileData}
                projectData={this.props.projectData}/> */}
          <Navbar>
            <Nav
              activeKey="/home"
              fill
              style={{ position: "absolute", top: 10, right: 10 }}
            >
              <Nav.Item>
                <Nav.Link href="/profile">Profile</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/projects">Projects</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/mystuff">MyStuff</Nav.Link>
              </Nav.Item>
            </Nav>
            <div className="row aligner" style={{ height: "100%" }}>
              <div className="col-md-12">
                <div>
                  <span
                    className="iconify header-icon"
                    data-icon="la:laptop-code"
                    data-inline="false"
                  ></span>
                  <br />
                  <h1 className="mb-0">{name}</h1>
                  <div className="title-container">
                    <HeaderTitleTypeAnimation />
                  </div>
                </div>
              </div>
            </div>
          </Navbar>
          <Routes>
            {/* <Route path="/data" element={<Navigation profileData={this.state.profileData}
                projectData={this.state.projectData}/>} /> */}

            {/* <Route path="/" element={<Landingpage profileData={this.props.profileData}
                projectData={this.props.projectData}/>} /> */}

            <Route path="/profile" element={<Profile />} />

            <Route
              path="/projects"
              element={
                <Projects2
                  profileData={this.props.profileData}
                  projectData={this.props.projectData}
                />
              }
            />

            <Route path="/mystuff" element={<MyStuff />} />

            <Route path="/profile/skills" element={<Skills />} />

            <Route path="/profile/stackprogress" element={<StackProgress />} />

            <Route path="/profile/education" element={<Education />} />

            <Route path="/profile/experience" element={<Experience />} />

            <Route path="/profile/achievements" element={<Achievements />} />
          </Routes>
        </Router>
      </header>
    );
  }
}

export default Header;
